import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Sidebar from "./Sidebar";
import PlaceOrder from "./PlaceOrder";
import ModifyOrder from "./ModifyOrder"; // Import Order Modify Component
import PnlReport from "./PnlReport"; // Import PNL Report Component

function App() {
  return (
    <Router>
      <div className="flex">
        <Sidebar />
        <div className="flex-grow p-4">
          <Routes>
            <Route path="/place-order" element={<PlaceOrder />} />
            <Route path="/modify-order" element={<ModifyOrder />} />
            <Route path="/pnl-report" element={<PnlReport />} />
          </Routes>
        </div>
      </div>
    </Router>
  );
}

export default App;
